import React from 'react';
import { ListGroup } from 'react-bootstrap';

const AnimalSidebar = () => {
  return (
    <div className="sidebar-section">
      <ListGroup>
        <ListGroup.Item active>Animales</ListGroup.Item>
        <ListGroup.Item action href="#">Perros en adopción</ListGroup.Item>
        <ListGroup.Item action href="#">Gatos en adopción</ListGroup.Item>
        <ListGroup.Item action href="#">Casos urgentes</ListGroup.Item>
        <ListGroup.Item action href="#">Animales adoptados</ListGroup.Item>
      </ListGroup>
    </div>
  );
};

export default AnimalSidebar;
